/**
 * 下载Blob文件
 * @param {Blob} blob - 用于下载的blob文件
 * @param {String} fileName - 下载后的名称
 */
export const downloadWithBlob = (blob: Blob, fileName: string = 'source', ext: string = 'wav') => {
    const timestamp = Date.now().toString();
    const link = document.createElement('a');
    document.body.append(link);
    link.download = `${fileName}_${timestamp}.${ext}`;
    link.href = URL.createObjectURL(blob);
    link.click();
    link.remove();
};

/**
* 下载Blob文件
* @param {String} blobUrl - 用于下载的blob文件
* @param {String} fileName - 下载后的名称
*/
export const downloadWithBlobUrl = (blobUrl: string, fileName: string = 'source', ext: string = 'wav') => {
    const timestamp = Date.now().toString();
    const link = document.createElement('a');
    document.body.append(link);
    link.download = `${fileName}_${timestamp}.${ext}`;
    link.href = blobUrl;
    link.click();
    link.remove();
};

/**
 * 播放BlobUrl
 * @param {String} audioBlobUrl 
 * @param {Function} onMessage 
 */
export const playBlobUrl = (audioBlobUrl: string, onMessage: Function) => {
    const audio = new Audio();
    audio.src = audioBlobUrl;
    audio.oncanplay = () => {
        console.info("开始播放");
        onMessage && onMessage("开始播放");
        audio.play()
    };
    audio.onerror = err => {
        if (audio.currentSrc.lastIndexOf("stop") !== -1) {
            console.info("音频停止");
            onMessage && onMessage("音频停止");
        } else {
            console.error("音频播放错误，请检查音频文件是否正确", err);
        }
    };
};

/**
 * 调用API将音频转换成文本
 * @param {String} base64Data
 */
export const transcriptions = async (base64Data: string) => {
    const api: string = process.env.WHISPER_API_PATH || "https://abidlabs-whisper.hf.space/run/predict";
    if(base64Data.indexOf("data:audio/wav;base64,") === 0) {
        base64Data = base64Data.replace("data:audio/wav;base64,", "");
    }

    const response = await fetch(api, {
        method: "POST",
        headers: { "Content-Type": "application/json" },
        body: JSON.stringify({
            data: [
                { name: "record.wav", data: `data:audio/wav;base64,${base64Data || _AUDIO_DEMO_[1]}` }
            ]
        })
    });

    const { duration, data: [ data ] } = await response.json();
    console.debug(duration, data);
    return { duration, data };
};

/**
 * 读取音频数据转为base64
 * @param {Blob} audioBlob
 */
// export const audioReader: Promise<string> = (audioBlob: Blob) => {
export function audioReader(audioBlob: Blob): Promise<string> {
    return new Promise<string>((resolve, reject) => {
        const reader = new FileReader();
        reader.onloadend = () => {
            if (typeof reader.result === 'string') {
                resolve(reader.result);
            } else {
                reject(new Error('转换为 base64 字符串时发生错误。'));
            }
        };
        reader.onerror = () => reject(new Error('读取文件时发生错误。'));

        reader.readAsDataURL(audioBlob);
    });
};

/**
 * 本地的WhisperAPI
 * @param {FileList} files 
 */
export const localWhisper = async (files: FileList | null) => {
    const response = await fetch('/api/whisper', {
        method: 'POST',
        body: files?.[0]
    });

    if (response.ok) {
        console.log('音频文件识别成功。');
        return await response.json();
    } else {
        console.error('识别音频文件失败！');
    }
};